   "iso_3166_1": "ES",
   "name": "Español",
   "data": {
    "biography": "William Bradley Pitt (Shawnee, Oklahoma; 18 de diciembre de 1963) es un actor y productor de cine estadounidense. Además de por su trabajo interpretativo, por el que ha sido nominado en tres ocasiones a los Premios Óscar y en cuatro a los Premios Globo de Oro.\n\nPitt comenzó su carrera interpretativa al aparecer como invitado en programas de televisión, entre los cuales se incluye un papel en el serial televisivo de CBS, Dallas (1987). Posteriormente, obtuvo reconocimiento de la prensa con la interpretación del cowboy autoestopista que seduce al personaje de Geena Davis en la película Thelma & Louise (1991). Los primeros papeles protagónicos de Pitt en producciones de alto presupuesto fueron A River Runs Through It (1992) y Entrevista con el vampiro (1994). También participó junto con Anthony Hopkins en el drama Leyendas de pasión (1994), papel que le hizo obtener su primera nominación a los Premios Globo de Oro.\n\nEn 1995 recibió aclamación de la crítica por sus interpretaciones en el filme de suspense Se7en y en el de ciencia ficción Doce monos, siendo esta última la que lo hizo ganar un Globo de Oro en la categoría de «mejor actor de reparto» y una nominación al Premio Óscar. Cuatro años más tarde, protagonizó el éxito de culto Fight Club (1999), y poco después actuó en el exitoso filme Ocean's Eleven (2001)."
   },
   "english_name": "es"
  },
  {
   "iso_639_1": "ru",
   "iso_3166_1": "RU",
   "name": "Pусский",
   "data": {
    "biography": "Уи́льям Брэ́дли Питт (англ. William Bradley Pitt; 18 декабря 1963 года, Шони, Оклахома, США), более известный как Брэд Питт (Brad Pitt) — американский актёр и продюсер. Лауреат премии «Золотой глобус» за 1995 год — за роль второго плана в ленте «Двенадцать обезьян». Обладатель премии «Оскар» как один из продюсеров фильма «12 лет рабства» — победителя в категории «Лучший фильм» на церемонии 2014 года; до этой победы четыре раза становился «оскаровским» номинантом: трижды — как актёр и один раз — как продюсер.\n\nУильям Брэдли Питт родился в городе Шони (штат Оклахома, США), вырос в очень религиозной американской семье. Его отец, Уильям Питт, работал менеджером в компании, занимавшейся грузоперевозками, мать, Джейн Этта Хиллхаус, — преподавателем в местной школе. Он, его брат Даг Питт и сестра Джулия Питт росли в Спрингфилде (штат Миссури), куда семья переехала вскоре после его рождения. В школе Питт занимался спортом, состоял в дебатном клубе, музыкальной секции и участвовал в студенческом самоуправлении. После школы Уильям поступил в университет Миссури — Колумбия, где изучал журналистику и рекламное дело. Однако после окончания университета по профессии работать он не пошёл, а отправился в Голливуд с целью начать актёрскую карьеру. Там он сменил своё имя на «Брэд Питт»"
   },
